import React from 'react';
import { WuphfForm } from './components';
import './App.css';

const formOptions = [
  {
    key: 'from_name',
    labelText: 'Your Name',
    placeholder: "So they know who it's from...",
    inputType: 'text'
  },
  {
    key: 'sms_number',
    labelText: 'SMS Number',
    placeholder: 'Phone number to text...',
    inputType: 'text'
  }
];

function App() {
  return (
    <div className='App'>
      <WuphfForm formOptions={formOptions}></WuphfForm>
    </div>
  );
}

export default App;
